import React, { useEffect, useState } from 'react';
import '../../css/exam.css';
import axios from 'axios';
import { useLocation, useNavigate } from 'react-router-dom';

const Exam = () => {
    const [userRole, setUserRole] = useState('');
    const navigate = useNavigate();
    const user = JSON.parse(sessionStorage.getItem("user"));
    const [exam, setExam] = useState([]);
    const [noExamFound, setNoExamFound] = useState(false);

    async function getExam() {
        try {
            const res = await axios.get("http://localhost:5000/api/get-all-exam");
            if (res.data.success) {
                setNoExamFound(true);
                setExam(res.data.user);
            } else {
                setNoExamFound(false);
            }
        } catch (error) {

        }
    }

    function logout() {
        sessionStorage.removeItem("user");
        sessionStorage.removeItem("userEmail");
        localStorage.removeItem("token");
        navigate('/login');
    }

    useEffect(() => {
        if (user?.isAdmin) {
            setUserRole("Admin");
        } else {
            setUserRole("User");
        }

    }, [user]);

    return (
        <div>

            <div className='div-box'>
                <div className='left-side-nav-bar'>

                    <div className='nav-bar'>
                        <div className='home-btn' onClick={() => navigate('/home')}>
                            <label>Home</label>
                        </div>

                        <div className='report-btn' onClick={() => navigate('/reports')}>
                            <label>Reports</label>
                        </div>

                        {user.isAdmin && (
                            <div className='exam-btn' onClick={() => navigate('/exam')}>
                                <label>Exam</label>
                            </div>
                        )}

                        <div className='logout-btn' onClick={logout}>
                            <label>Logout</label>
                        </div>
                    </div>

                </div>

                <div className='exam-top-menu'>
                    <label className='title'>Quiz Application</label>
                    <div className='details'>
                        <label className='name'>Name: {user?.username}</label><br />
                        <label className='role'>Role: {userRole}</label>
                    </div>
                </div>

                <button className='add-exam' onClick={() => navigate('/exam/add')} >+Add Exam</button>

                <div className='table-exam-div'>
                    <label>dggzsrgdthdjyhjy</label>
                    <div>
                        <table >
                            <tr >
                                <th>Exam Name</th>
                                <th>Duration</th>
                                <th>Category</th>
                                <th>Total Marks</th>
                                <th>Passing Marks</th>
                                <th>Action</th>
                            </tr>
                            {[...Array(50)].map((_, index) => (
                                <tr key={index}>
                                    <td>GK</td>
                                    <td>60</td>
                                    <td>Java</td>
                                    <td>10</td>
                                    <td>1</td>
                                    <td>
                                        <button>Edit</button>&emsp;
                                        <button>Delete</button>
                                    </td>
                                </tr>
                            ))}
                        </table>

                    </div>
                </div>

            </div>
        </div>
    );
};

export default Exam;
